import Sliader from '../../components/Home/Sliader'
import HomeCategory from '../../components/Home/HomeCategory'
import ProdactCardContiner from '../../'
function HomePage() {
    return (
      <div className="font" >
        <NavebarPage/>
        <Sliader/>
        <HomeCategory />
        <ProdactCardContiner />
        
      </div>
    );
  }
  
  export default HomePage;
